import React from "react";

function Movie() {
  return <h3>I like Movie</h3>;
}

function App() {
  return (
    <div>
      <h1>Hello!!</h1>
      <Movie />
      <Movie />
      <Movie />
      <Movie />
      <Movie />
    </div>
  );
}

export default App;
